import ReactDOM from 'react-dom';
//JSX
// ap array of elements vi use kr sakte ho react js mai
ReactDOM.render(
    <>
    <h1>Asit technical netflix app</h1>
    <p> Here the list of my fav 5 netflix series </p>
    <ol>
        <li>Dark</li>
        <li>Light</li>
        <li>Fight</li>
        <li>sight</li>
        <li>body</li>
    </ol>
    </>
    ,document.getElementById("root")

);

